import React, { Component } from 'react';

// Component
import Header from './comp/Header';
class App extends Component {
  render() {
    return (
      <div id="content-wrapper" className="d-flex flex-column">
        <Header />
        <div className="container-fluid">

        </div>
      </div>
    );
  }
}

export default App;
